import React from 'react';
import { Routes, Route, NavLink, Outlet } from 'react-router-dom';
import { Send, Paperclip, Image, Layout, Home, Settings, Users, FileText } from 'lucide-react';
import Navbar from './Navbar';
import './Dashboard.css';

const Sidebar = () => {
  return (
    <div className="sidebar">
      <nav>
        <NavLink to="/dashboard/home" className={({ isActive }) => isActive ? 'active-link' : 'nav-link'}>
          <Home className="sidebar-icon" />
          <span>Home</span>
        </NavLink>
        <NavLink to="/dashboard/test-cases" className={({ isActive }) => isActive ? 'active-link' : 'nav-link'}>
          <FileText className="sidebar-icon" />
          <span>Test Cases</span>
        </NavLink>
        <NavLink to="/dashboard/users" className={({ isActive }) => isActive ? 'active-link' : 'nav-link'}>
          <Users className="sidebar-icon" />
          <span>Users</span>
        </NavLink>
        <NavLink to="/dashboard/settings" className={({ isActive }) => isActive ? 'active-link' : 'nav-link'}>
          <Settings className="sidebar-icon" />
          <span>Settings</span>
        </NavLink>
      </nav>
    </div>
  );
};

const HomePage = () => {
  const suggestedPrompts = {
    'Automate Case generation': [
      'Create a test case for signup page',
      'Create a test case for user is able to click on input field',
      'Test Case For Role Management'
    ],
    'Test Case Execution': [
      'Create a check list for Role management test cases',
      'Create a Checklist for Signup page',
      'Test Case For Role Management'
    ],
    'Code Import and Upload': [
      'Lorem ipsum dolor sit amet, consectetur adipiscing elit.',
      'Lorem ipsum dolor sit amet, conse',
      'Lorem Ipsum Dolor Sit Amet.'
    ]
  };

  const PromptCard = ({ text }) => (
    <div className="prompt-card">
      <span className="prompt-text">{text}</span>
      <span className="arrow-icon">
        <svg viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="2">
          <path d="M9 5l7 7-7 7" />
        </svg>
      </span>
    </div>
  );

  return (
    <div className="dashboard-content">
      <div className="header">
        <h1 className="main-title">
          Unveiling the Power of Test Case Generation and Execution
        </h1>
        <p className="subtitle">
          Software testing with automated case generation, execution, and meticulous scrutiny, ensuring precision and efficiency in development workflows.
        </p>
      </div>

      <div className="prompts-section">
        <div className="prompts-header">
          <span className="sparkle">✨</span>
          <h2 className="section-title">Suggested Prompts</h2>
        </div>

        <div className="prompts-grid">
          {Object.entries(suggestedPrompts).map(([category, prompts]) => (
            <div key={category} className="category-card">
              <h3 className="category-title">{category}</h3>
              {prompts.map((prompt, index) => (
                <PromptCard key={index} text={prompt} />
              ))}
            </div>
          ))}
        </div>
      </div>

      {/* Input Section */}
      <div className="input-section">
        <div className="input-container">
          <input
            type="text"
            placeholder="How can I help you?"
            className="main-input"
          />
          <div className="action-buttons">
            <button className="icon-button">
              <Paperclip className="icon" />
            </button>
            <button className="icon-button">
              <Image className="icon" />
            </button>
            <button className="icon-button">
              <Layout className="icon" />
            </button>
            <button className="send-button">
              <Send className="send-icon" />
              Send
            </button>
          </div>
        </div>
      </div>
    </div>
  );
};

const TestCasesPage = () => (
  <div className="dashboard-content">
    <h1>Test Cases</h1>
    {/* Add test cases content */}
  </div>
);

const UsersPage = () => (
  <div className="dashboard-content">
    <h1>Users Management</h1>
    {/* Add users management content */}
  </div>
);

const SettingsPage = () => (
  <div className="dashboard-content">
    <h1>Settings</h1>
    {/* Add settings content */}
  </div>
);

const Dashboard = () => {
  return (
    <div className="dashboard-layout">
      <Navbar />
      <div className="dashboard-main">
        <Sidebar />
        <div className="dashboard-content-wrapper">
          <Routes>
            <Route path="home" element={<HomePage />} />
            <Route path="test-cases" element={<TestCasesPage />} />
            <Route path="users" element={<UsersPage />} />
            <Route path="settings" element={<SettingsPage />} />
            <Route path="" element={<HomePage />} />
          </Routes>
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
